Actionscript.script:
function 攻击时移动(慢速度, 快速度)
{
   if(_parent.方向 == "右")
   {
      _parent.移动("右",慢速度);
   }
   else if(_parent.方向 == "左")
   {
      _parent.移动("左",慢速度);
   }
}
gotoAndPlay(_parent.近战招式);

onClipEvent (load) {
	子弹属性 = _root.子弹属性初始化(this);
	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "re_shotgun_725.wav";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 1;
	子弹属性.子弹种类 = "巴雷特子弹";
	子弹属性.子弹威力 = 3900 * _root.难度等级 + _parent._parent.空手攻击力;
	var 宠物 = _parent._parent;
	var 属性 = 宠物.宠物属性;
	if (属性)
	{
		// 缓存目标对象，避免重复查找_root
		var 敌方目标 = _root.gameworld[宠物.攻击目标];

		// --- 第一步：统一计算敌方防御属性 ---
		var 敌方防御减伤 = (敌方目标.防御力 / (敌方目标.防御力 + 300)) * 100;
		// 如果魔抗有基础值取基础值，否则按公式计算
		var 敌方魔抗 = 敌方目标.魔法抗性.基础 ? 敌方目标.魔法抗性.基础 : (10 + 敌方目标.等级 / 2);

		// --- 第二步：计算三种子弹的“预期伤害得分” (基准为100) ---
		// 1. 物理得分：直接看剩余多少百分比
		var 得分_物理 = 100 - 敌方防御减伤;

		// 2. 能量得分：根据是否拥有剧毒技能，倍率不同 (剧毒层级下0.75，纯能量层级下0.8)
		// 注意：这里先算一个基础的魔抗收益，后面根据倍率乘
		var 基础魔法收益 = 100 - 敌方魔抗;

		var 得分_能量 = 基础魔法收益 * 0.9;

		// 3. 剧毒得分：50%的物理收益 + 35的真实伤害收益
		var 得分_剧毒 = (得分_物理 * 0.5) + 33.3;


		// --- 第三步：逻辑判断与应用 ---

		if (属性.剧毒子弹)
		{
			// === Level 50+ 档次 ===
			子弹属性.子弹威力 += (宠物.等级 - 50) * 100 * _root.难度等级;


			// 决策逻辑：比较 能量 vs 剧毒 vs 物理
			// 优先级：先看能量是否最高，再看剧毒是否比物理高

			if (属性.能量子弹 && 得分_能量 > 得分_物理 && 得分_能量 > 得分_剧毒)
			{
				// 能量子弹最优
				子弹属性.子弹威力 *= 0.9;
				子弹属性.伤害类型 = "魔法";
				子弹属性.子弹种类 = "巨型穿刺能量子弹";
			}
			else if (得分_剧毒 > 得分_物理)
			{
				// 剧毒子弹最优
				子弹属性.毒 = 子弹属性.子弹威力 * 1;
				子弹属性.子弹威力 *= 0.5;
				子弹属性.子弹种类 = "毒穿刺子弹";
			}
			// else { 保持默认物理属性 } 
			子弹属性.斩杀 = 20;
			// 暴击逻辑 (剧毒层级统一暴击)
			子弹属性.暴击 = function()
			{
				return _root.成功率(50) ? 2 : 1;
			};
		}
		else if (属性.能量子弹)
		{

			if (得分_能量 > 得分_物理)
			{
				子弹属性.子弹威力 *= 0.9;
				子弹属性.伤害类型 = "魔法";
				子弹属性.子弹种类 = "巨型穿刺能量子弹";
			}
			子弹属性.斩杀 = 10;
			// 暴击逻辑 (能量层级统一暴击) 
			子弹属性.暴击 = function()
			{
				return _root.成功率(30) ? 1.5 : 1;
			};
		}
	}
	/*
