			子弹属性.伤害类型 = "魔法";
			子弹属性.子弹种类 = "巨型穿刺能量子弹";
		}
		else if (敌方防御减伤 >= 60)
		{
			子弹属性.毒 = 子弹属性.子弹威力 * 1;
