		var 敌方魔抗 = 敌方目标.魔法抗性.基础 ? 敌方目标.魔法抗性.基础 : 10 + 敌方目标.等级 / 2;
		if ((100 - 敌方魔抗) * 0.6 > (100 - 敌方防御减伤))
